import React, { useEffect, useState } from "react";
import axios from "axios";

const Home = () => {
  const [resumes, setResumes] = useState([]);

  useEffect(() => {
    // Fetch resumes from backend API
    axios.get("http://localhost:5000/api/resumes")
      .then((response) => {
        setResumes(response.data);
      })
      .catch((error) => console.error("Error fetching resumes:", error));
  }, []);

  return (
    <div>
      <h1>Resume List</h1>
      <ul>
        {resumes.map((resume) => (
          <li key={resume._id}>{resume.name} - {resume.email}</li>
        ))}
      </ul>
    </div>
  );
};

export default Home;
